response.about:
Как все человекоразумные, имею некоторые слабости. Мое сердце тает от:
- блестящего знания географической номенклатуры и интереса к науке в общем;
- живописной природы во всех ее проявлениях и людей, любящих оную;
- мелодичной и нестандартной музыки;
- людей, создающих нечто свое, а не копирующих чужое;
- творчества во благо и созидание;
- душевных, прочувствованных книг;
- грамотности и воспитанности, широкого кругозора;
- ответственности и отзывчивости;
- котиков.
